<script setup>import { reactive, ref } from "@vue/reactivity";
import Cookies from "js-cookie";
import { get, post } from "@/http/api";
name:'Withdraw'
const isclick = reactive({
    ispaypl:false,
    isalipay:false,
    isvisa:false,
    isach:false,
    iszelle:false,
    isaccountnumber:true,
    way:'',
    amount:'',
    receiveaccount:'',
    name:'',
    routingnumber:'',
    zellename:'',
    zelleemail:'',
});
const choosepaypl = () =>{
    isclick.ispaypl=true;
    isclick.isalipay=false;
    isclick.isvisa=false;
    isclick.iszelle=false;
    isclick.isaccountnumber=true;
    isclick.way = 'paypal';
    isclick.isach = false;
};
const choosealipay = () =>{
    isclick.ispaypl=false;
    isclick.isalipay=true;
    isclick.isvisa=false;
    isclick.iszelle=false;
    isclick.isaccountnumber=true;
    isclick.way = '支票';
    isclick.isach = false;
};
const choosevisa = () =>{
    isclick.ispaypl=false;
    isclick.isalipay=false;
    isclick.isvisa=true;
    isclick.isach = true;
    isclick.isaccountnumber=true;
    isclick.iszelle=false;
    isclick.way = 'ACH';
};
const choosezelle = () =>{
    isclick.ispaypl=false;
    isclick.isalipay=false;
    isclick.isvisa=false;
    isclick.isach = false;
    isclick.isaccountnumber=false;
    isclick.iszelle=true;
    isclick.way = 'zelle';
};
// 提示
const tip = reactive({
    hit:'',
    isshow:false,
})
// 提交提现请求
const postBalance = () =>{
    if (isclick.way == '')
    {
        tip.hit = 'Please select the payment method';
        tip.isshow = true;
    }
    else if (isclick.way == 'zelle')
    {
        if (isclick.zellename == '')
        {
            tip.hit = 'Please enter the Zelle name';
            tip.isshow = true;
        }
        else{
            let data = {token:Cookies.get('token'),withdrawalamount:isclick.amount,way:isclick.way,receiveaccount:'None',name:'None',routingnumber:'None',zellename:isclick.zellename,zelleemail:isclick.zelleemail};
            post("/api/v1/zelle/", data).then((res) => {
                console.log(res);
                tip.hit = res.data.msg;
                tip.isshow = true;
            });
        }
    }
    else if (isclick.way == 'ACH')
    {
        if (isclick.name == '')
        {
            tip.hit = 'Please enter the ACH name';
            tip.isshow = true;
        }
        else
        {
            let data = { token:Cookies.get('token'),withdrawalamount:isclick.amount,way:isclick.way,receiveaccount:isclick.receiveaccount,name:isclick.name,routingnumber:isclick.routingnumber,zelleemail:'None',zellename:'None'};
            post("/api/v1/ach/", data).then((res) => {
                console.log(res);
                tip.hit = res.data.msg;
                tip.isshow = true;
            });
        }
    }
    else if (isclick.way == 'paypal' || isclick.way == '支票')
    {
        if (isclick.receiveaccount == '')
        {
            tip.hit = 'Please enter the Account number';
            tip.isshow = true;
        }
        else
        {
            let data = {token:Cookies.get('token'),withdrawalamount:isclick.amount,way:isclick.way,receiveaccount:isclick.receiveaccount,name:'None',routingnumber:'None',zelleemail:'None',zellename:'None'};
            post("/api/v1/withdrawlist/", data).then((res) => {
                console.log(res);
                tip.hit = res.data.msg;
                tip.isshow = true;
            });
        }
    }
};
// 关闭提示
const closeReghint = () => {
    tip.isshow = false
}
</script>

